def main():
    n = F()
    nn = n**2
    r = n * (2**0.5)
    for i in range(int(n)+1):
        kk = nn - i**2
        if kk < 0:
            break
        k = kk ** 0.5
        tr = i + k
        if k < 1:
            tr += 1-k
        if r < tr:
            r = tr

    return r

print(main())

